import AdminNavbar from "./DashboardComponents/AdminDashNav";
import AdminSidebar from "./DashboardComponents/Adminsidebar";
import DrugCategory from "./DashboardComponents/DrugCategory";
import Staff_Stats_cards from "./DashboardComponents/Staff_Stats_cards";
import "./index.css";

const AdminStaffs = () => {
  return (
    <>
      <div className="contaniner-fluid">
        <div className="row">
          <AdminSidebar />
          <div className="col-md-9 dashboardmainarea">
            <AdminNavbar />
            <div className="dashboard_main_area pb-0 row">
              <Staff_Stats_cards />
              <div className="col-md-11 expand12">
                <div className="row jcenter">
                  <div className="col-md-8 charthome">
                    {/* <DashbaordGraph /> */}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default AdminStaffs;
